export const getSeanceTypes = async (): Promise<SeanceType[]> => {
  if (import.meta.env.DEV) {
    return MOCK_SEANCE_TYPES;
  }
  const response = await axios.get(`${API_BASE_URL}/sessions`);
  return response.data;
};

